trolley_4_just:
Δεν θεωρώ ότι η ενέργεια αυτή μπορεί να χαρακτηριστεί ηθικώς αποδεκτή ή απαράδεκτη.
Βλέπω δυο απαντήσεις αντίρροπες μεταξύ τους που όμως η αιτιολόγηση τους είναι ισοδύναμη .Απο την μια αν σπρώξει τον έναν(επομενως τον σκοτώσει) θα σώσει τους 5 από την άλλη γιατί να πεθάνει ο ένας για να σωθούν οι 5; Και αυτός ο ένας; Δεν έχει ζωή; Ή επειδή είναι ένας είναι μικρότερη η ζωή του από τους 5 μαζί;
Αν λόγου χάριν είχαμε να κάνουμε με την διάσωση 5 μικρών παιδιών τότε ίσως κατευθυνόμουν ως προς το ηθικά αποδεκτό όμως ύστερα από κάποια σκέψη πάλι.Οπως επίσης και αν ο ένας,ήταν ένα παιδί.Θα θεωρούσα πως είναι άδικο να χαθεί για να σώσει 5.Δεν ξέρω τι ακριβώς υποδηλώνει αυτό.Παντως η απάντηση γίνεται όλο και πιο δύσκολη όσο το σκέφτομαι και ως επι το πλείστον δεν έχω κάποια απάντηση ξεκάθαρη.
